import './modal.css';
import TextField from '@material-ui/core/TextField';
import { makeStyles } from '@material-ui/core/styles';


function Modal({ data, handleClose, show, children }) {
    const showHideClassName = show ? "modal display-block" : "modal display-none";




    return (

        <div className={showHideClassName}>
            <form className="modal-main">
                <TextField
                id="standard-number"
                label="Lånebeløp"
                type="Number"/>
                <TextField
                id="standard-number"
                label="Lånebeløp"
                type="Number"/>
                <TextField
                id="standard-number"
                label="Lånebeløp"
                type="Number"/>
                <TextField
                id="standard-number"
                label="Lånebeløp"
                type="Number"/>
                {children}
                <button onClick={handleClose}>close</button>
            </form>
        </div>

    )

}
export default Modal;
